&nbsp;&nbsp;<table width="710" border="0" cellspacing="0" cellpadding="0"  id="caution_desc"><tbody><tr><th style="color: #e00;font-weight: bold;">！ご注文前にご確認ください</th></tr><tr><td>当店、実店舗と自社サイトを含む共有在庫となり、ご注文のタイミングによっては商品をご用意できない場合がございます。<br>ご用意出来なかった場合につきましては、ご注文のキャンセルとさせて頂きます。<br>その他、当店のご注文の流れをページ下部にて、予めご確認ください。</td></tr></tbody></table><img src='http://image.rakuten.co.jp/pc-good/cabinet/optionset/os_caution.gif' id='item-os'><div style="margin-bottom: 20px"><a href="http://www.rakuten.ne.jp/gold/eco-return/guide/shiroromu.html#03"><img src="http://www.rakuten.ne.jp/gold/eco-return/common_img/redrom.gif"></a></div><style><!--.iosys_table_01 {width:710px;margin:20px 0;padding:0px;border-collapse:collapse;border-top:1px dotted #999999;font-size:18px;line-height: 1.8;}.iosys_table_01 th {width:21%;padding: 12px;text-align:left;vertical-align:top;color:#666666;background-color:#EEEEEE;border-bottom:1px dotted #999999;border-left:5px solid #53678B;font-weight:bold;font-size: 14px;}.iosys_table_01 td {padding: 12px;border-bottom:1px dotted #999999;border-right:1px dotted #999999;border-left:3px double #CCCCCC;}.iosys_photo {width:110px;margin:20px 0px 0px 0px;text-align:center;}    .iosys_photo p {margin:0;padding:0;}--></style><table class='iosys_table_01'><tr><th>■主な性能、機能</th><td><div class='spec'><span class='spec spec20'>OS:</span>iOS9以上 <br><span class='spec spec20'>CPU:</span>Apple A9+M9モーションコプロセッサ <br><span class='spec spec20'>RAM:</span>2GB <br><span class='spec spec20'>ストレージ:</span>128GB <br><span class='spec spec20'>液晶サイズ:</span>5.5インチ(1920x1080) <br><span class='spec spec20'>外部メモリ:</span>非対応 <br><span class='spec spec20'>カメラ機能:</span>1200万画素/500万画素 <br><span class='spec spec20'>対応ネットワーク:</span>CDMA EV-DO Rev.A(800、1700/2100、1900、2100MHz) TD-SCDMA(1900(F)/2000(A)) UMTS/HSPA+/DC-HSDPA(850、900、1700/2100、1900、2100MHz) GSM/EDGE(850/900/1800/1900MHz) LTE(バンド1/2/3/4/5/7/8/12/13/17/18/19/20/25/26/27/28/29)TD-LTE(38/39/40/41) <br><span class='spec spec20'>Wi-Fi:</span>a/b/g/n/ac <br><span class='spec spec20'>その他:</span>3D Touch/4Kビデオ撮影/Retina Flash/Touch ID/GPS/iTunes/Bluetooth4.2/NFC<br><span class='spec spec20'>本体重量:</span>192g <br><span class='spec spec20'>SIMカードサイズ:</span>nanoSIM <br><span class='spec spec20'>発売日:</span>2015年9月</div></td></tr><tr><th>■付属品</th><td>箱/USB電源アダプタ/Lightningケーブル/イヤホン/SIMカードツール/クイックスタートガイド</td></tr><tr><th>■保証期間</th><td><p class="support range">当社６ヶ月保証</p><a href='http://www.rakuten.ne.jp/gold/eco-return/guide/' target='_blank' class='strong'>保証の詳しい内容はこちらでご確認下さい</a></td></tr></table><div class="item-page about-rank"><p>この商品は<span>未使用品</span>です。</p></div><div style="margin-bottom: 20px;"><img src="http://image.rakuten.co.jp/pc-good/cabinet/1509_1/about-rank-mobile.gif" alt=""></div><style>



